CREATE TABLE qrtz_job_details ( JOB_NAME VARCHAR2(200) NOT NULL, JOB_GROUP VARCHAR2(200) NOT NULL, DESCRIPTION VARCHAR2(250) NULL, JOB_CLASS_NAME VARCHAR2(250) NOT NULL, IS_DURABLE number(1) NOT NULL, IS_VOLATILE number(1) NOT NULL, IS_STATEFUL number(1) NOT NULL, REQUESTS_RECOVERY number(1) NOT NULL, JOB_DATA BLOB NULL, PRIMARY KEY (JOB_NAME,JOB_GROUP) );
CREATE TABLE qrtz_job_listeners ( JOB_NAME VARCHAR2(200) NOT NULL, JOB_GROUP VARCHAR2(200) NOT NULL, JOB_LISTENER VARCHAR2(200) NOT NULL, PRIMARY KEY (JOB_NAME,JOB_GROUP,JOB_LISTENER), FOREIGN KEY (JOB_NAME,JOB_GROUP) REFERENCES QRTZ_JOB_DETAILS(JOB_NAME,JOB_GROUP) );
CREATE TABLE qrtz_triggers ( TRIGGER_NAME VARCHAR2(200) NOT NULL, TRIGGER_GROUP VARCHAR2(200) NOT NULL, JOB_NAME VARCHAR2(200) NOT NULL, JOB_GROUP VARCHAR2(200) NOT NULL, IS_VOLATILE NUMBER(1) NOT NULL, DESCRIPTION VARCHAR2(250) NULL, NEXT_FIRE_TIME number(38) NULL, PREV_FIRE_TIME number(38) NULL, PRIORITY INTEGER NULL, TRIGGER_STATE VARCHAR2(16) NOT NULL, TRIGGER_TYPE VARCHAR2(8) NOT NULL, START_TIME number(38) NOT NULL, END_TIME number(38) NULL, CALENDAR_NAME VARCHAR2(200) NULL, MISFIRE_INSTR NUMBER(5) NULL, JOB_DATA BLOB NULL, PRIMARY KEY (TRIGGER_NAME,TRIGGER_GROUP), FOREIGN KEY (JOB_NAME,JOB_GROUP) REFERENCES QRTZ_JOB_DETAILS(JOB_NAME,JOB_GROUP) );
CREATE TABLE qrtz_simple_triggers ( TRIGGER_NAME VARCHAR2(200) NOT NULL, TRIGGER_GROUP VARCHAR2(200) NOT NULL, REPEAT_COUNT number(38) NOT NULL, REPEAT_INTERVAL number(38) NOT NULL, TIMES_TRIGGERED number(38) NOT NULL, PRIMARY KEY (TRIGGER_NAME,TRIGGER_GROUP), FOREIGN KEY (TRIGGER_NAME,TRIGGER_GROUP) REFERENCES QRTZ_TRIGGERS(TRIGGER_NAME,TRIGGER_GROUP) );
CREATE TABLE qrtz_cron_triggers ( TRIGGER_NAME VARCHAR2(200) NOT NULL, TRIGGER_GROUP VARCHAR2(200) NOT NULL, CRON_EXPRESSION VARCHAR2(120) NOT NULL, TIME_ZONE_ID VARCHAR2(80), PRIMARY KEY (TRIGGER_NAME,TRIGGER_GROUP), FOREIGN KEY (TRIGGER_NAME,TRIGGER_GROUP) REFERENCES QRTZ_TRIGGERS(TRIGGER_NAME,TRIGGER_GROUP) );
CREATE TABLE qrtz_blob_triggers ( TRIGGER_NAME VARCHAR2(200) NOT NULL, TRIGGER_GROUP VARCHAR2(200) NOT NULL, BLOB_DATA BLOB NULL, PRIMARY KEY (TRIGGER_NAME,TRIGGER_GROUP), FOREIGN KEY (TRIGGER_NAME,TRIGGER_GROUP) REFERENCES QRTZ_TRIGGERS(TRIGGER_NAME,TRIGGER_GROUP) );
CREATE TABLE qrtz_trigger_listeners ( TRIGGER_NAME VARCHAR2(200) NOT NULL, TRIGGER_GROUP VARCHAR2(200) NOT NULL, TRIGGER_LISTENER VARCHAR2(200) NOT NULL, PRIMARY KEY (TRIGGER_NAME,TRIGGER_GROUP,TRIGGER_LISTENER), FOREIGN KEY (TRIGGER_NAME,TRIGGER_GROUP) REFERENCES QRTZ_TRIGGERS(TRIGGER_NAME,TRIGGER_GROUP) );
CREATE TABLE qrtz_calendars ( CALENDAR_NAME VARCHAR2(200) NOT NULL, CALENDAR BLOB NOT NULL, PRIMARY KEY (CALENDAR_NAME) );
CREATE TABLE qrtz_paused_trigger_grps ( TRIGGER_GROUP VARCHAR2(200) NOT NULL, PRIMARY KEY (TRIGGER_GROUP) );
CREATE TABLE qrtz_fired_triggers ( ENTRY_ID VARCHAR2(95) NOT NULL, TRIGGER_NAME VARCHAR2(200) NOT NULL, TRIGGER_GROUP VARCHAR2(200) NOT NULL, IS_VOLATILE number(1) NOT NULL, INSTANCE_NAME VARCHAR2(200) NOT NULL, FIRED_TIME number(38) NOT NULL, PRIORITY INTEGER NOT NULL, STATE VARCHAR2(16) NOT NULL, JOB_NAME VARCHAR2(200) NULL, JOB_GROUP VARCHAR2(200) NULL, IS_STATEFUL NUMBER(1) NULL, REQUESTS_RECOVERY number(1) NULL, PRIMARY KEY (ENTRY_ID) );
CREATE TABLE qrtz_scheduler_state ( INSTANCE_NAME VARCHAR2(200) NOT NULL, LAST_CHECKIN_TIME number(38) NOT NULL, CHECKIN_INTERVAL number(38) NOT NULL, PRIMARY KEY (INSTANCE_NAME) );
CREATE TABLE qrtz_locks ( LOCK_NAME VARCHAR2(40) NOT NULL, PRIMARY KEY (LOCK_NAME) );
